import React from "react";
import "./profile.css";
import Header from "../../components/header/Header";
import Navbar from "../../components/navbar/Navbar";

function Profile() {
  return (
    <>
      <Navbar />
      <Header type={"mini"} />
    </>
  );
}

export default Profile;
